import { configureStore } from '@reduxjs/toolkit'
import dataSlice from './dataSlice'
import filterSlice from './filterSlice'

const store = configureStore({
  reducer: {
    dataSlice: dataSlice,
    filterSlice: filterSlice,
  },
})

export default store
